from sympy import prevprime
def intlog(n,base):
    ans=0
    while n>=base:
        n//=base
        ans+=1
    return (ans)
def count(n,s):
    if n==1:
        return 0
    if n==2:
        return intlog(s,n)
    else:
        p=prevprime(n+1)
        p2=prevprime(p)
        k=intlog(s,p)
        for i in range(k+1):
            k+=count(p2,s//(p**i))
        return(k)
